import React from 'react';
import Vivus from 'vivus';
import { Image} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../../src/app.css';


import Compass from "../resources/icons/svg/Compass.svg";
import Pawprint from "../resources/icons/svg/Pawprint.svg";
import BookVivus from "../resources/icons/vivus/Book.js";
import Team_animated from "../resources/icons/svg/Team.svg";
import Contact from "../resources/icons/svg/Contact.svg";

import CompassButton from '../resources/icons/svgr/CompassButton/index.jsx';
import Icon from '../resources/icons/js/FbButton.js';

class Sidebar extends React.Component{
    constructor(props) {
        super(props);
        this.state = { 
         checking:false
        };
        this.renderIcon = this.renderIcon.bind(this);
    }
    
  renderIcon(){
    
    return(
      <Link to="/bookstack"><div className="sidebar-button"><BookVivus onClick="BookVivus.reset().play();"/></div></Link>
    )
  }

  componentDidMount(){
    let Team_anim = new Vivus('Team_animated', {duration: 200, file:Team_animated}, null);
  }

    render(){
        return(
        <div className="main-sidebar">
            
            <Link to="/feed"><div className="sidebar-button"><CompassButton/></div></Link>S
            <Link to="/projects"><div className="sidebar-button"><Image src={Pawprint} width="100"/></div></Link>
            {this.renderIcon()}
            <Link to="/team"><div className="sidebar-button"><div id="Team_animated" width="100" onClick="Team_animated.reset().play();"/></div></Link>
            <Link to="/contact"><div className="sidebar-button"><Icon width={50} fill="none"/></div></Link>
        </div>
        );
    }   
    
    
}

export default Sidebar;
